import React from 'react'
import { Play } from '../Alies'

const run: React.FC<{value:Play}> = ({value})=> {

    if (value.play_type==="Run"){
        return (
            <div>
              {value.carrier} run for {value.yards_gained} for {value.result}
            </div>
          )
    }
  return null
}

export default run
